// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

interface IERC20 {
    function transferFrom(address sender, address recipient, uint256 amount) external returns (bool);
    function transfer(address recipient, uint256 amount) external returns (bool);
    function balanceOf(address account) external view returns (uint256);
    function approve(address spender, uint256 amount) external returns (bool);
}

interface IWETH {
    function deposit() external payable;
    function withdraw(uint256) external;
}

// Abstract contract defining the base functionality
abstract contract LendingBase {
    // Virtual functions that must be implemented
    function calculateCollateralAmount(address _collateralToken, uint _loanAmount) public view virtual returns (uint256);
    function getLoanInfo(uint _loanId) external view virtual returns (
        uint amount,
        uint interest,
        uint duration,
        uint repaymentAmount,
        uint fundingDeadline,
        address borrower,
        address lender,
        bool active,
        bool repaid,
        address collateralToken,
        uint collateralAmount
    );
}

contract P2PLending is LendingBase {
    // Token interfaces
    IERC20 public immutable USDC;
    IERC20 public immutable USDT;
    IERC20 public immutable WBTC;
    IWETH public immutable WETH;

    // Collateral ratios (150% = 15000, allowing for 2 decimal places)
    mapping(address => uint256) public collateralRatios;

    // The minimum and maximum amount that can be loaned (in USD cents)
    uint public constant MIN_LOAN_AMOUNT = 10000; // $100
    uint public constant MAX_LOAN_AMOUNT = 1000000; // $10,000

    uint public constant MIN_INTEREST_RATE = 1;
    uint public constant MAX_INTEREST_RATE = 10;

    struct Loan {
        uint amount;  // In USD cents
        uint interest;
        uint duration;
        uint repaymentAmount;
        uint fundingDeadline;
        address borrower;
        address payable lender;
        bool active;
        bool repaid;
        address collateralToken;
        uint collateralAmount;
    }

    mapping(uint => Loan) public loans;
    uint public loanCount;

    // Price feed contracts (would normally be chainlink oracles)
    mapping(address => uint256) public tokenPrices;

    event LoanCreated(
        uint loanId,
        uint amount,
        uint interest,
        uint duration,
        uint fundingDeadline,
        address borrower,
        address lender,
        address collateralToken,
        uint collateralAmount
    );
    event LoanFunded(uint loanId, address funder, uint amount);
    event LoanRepaid(uint loanId, uint amount);
    event CollateralReturned(uint loanId, address token, uint amount);
    event CollateralLiquidated(uint loanId, address token, uint amount);

    constructor(
        address _usdc,
        address _usdt,
        address _wbtc,
        address _weth
    ) {
        // Initialize token interfaces
        USDC = IERC20(_usdc);
        USDT = IERC20(_usdt);
        WBTC = IERC20(_wbtc);
        WETH = IWETH(_weth);

        // Set initial collateral ratios (150%)
        collateralRatios[_usdc] = 15000;
        collateralRatios[_usdt] = 15000;
        collateralRatios[_wbtc] = 15000;
        collateralRatios[_weth] = 15000;

        // Set mock prices for testing (would normally use oracles)
        tokenPrices[_usdc] = 100; // $1.00
        tokenPrices[_usdt] = 100; // $1.00
        tokenPrices[_wbtc] = 5000000; // $50,000
        tokenPrices[_weth] = 300000; // $3,000
    }

    modifier onlyActiveLoan(uint _loanId) {
        require(loans[_loanId].active, "Loan is not active");
        _;
    }

    modifier onlyBorrower(uint _loanId) {
        require(msg.sender == loans[_loanId].borrower, "Only borrower can perform this action");
        _;
    }

    // Implementation of abstract function from LendingBase
    function calculateCollateralAmount(
        address _collateralToken,
        uint _loanAmount
    ) public view override returns (uint256) {
        require(collateralRatios[_collateralToken] > 0, "Unsupported collateral token");

        uint256 tokenPrice = tokenPrices[_collateralToken];
        uint256 collateralRatio = collateralRatios[_collateralToken];

        // Calculate required collateral amount with 8 decimals precision
        uint256 requiredCollateral = (_loanAmount * collateralRatio * 1e8) / (tokenPrice * 100);

        return requiredCollateral;
    }

    function createLoan(
        uint _amount,
        uint _interest,
        uint _duration,
        address _collateralToken
    ) external payable {
        require(
            _amount >= MIN_LOAN_AMOUNT && _amount <= MAX_LOAN_AMOUNT,
            "Invalid loan amount"
        );
        require(
            _interest >= MIN_INTEREST_RATE && _interest <= MAX_INTEREST_RATE,
            "Invalid interest rate"
        );
        require(_duration > 0, "Invalid duration");
        require(collateralRatios[_collateralToken] > 0, "Unsupported collateral token");

        uint256 collateralAmount = calculateCollateralAmount(_collateralToken, _amount);

        // Handle collateral deposit
        if (_collateralToken == address(WETH)) {
            require(msg.value >= collateralAmount, "Insufficient ETH collateral");
            WETH.deposit{value: collateralAmount}();
        } else {
            require(
                IERC20(_collateralToken).transferFrom(msg.sender, address(this), collateralAmount),
                "Collateral transfer failed"
            );
        }

        uint _repaymentAmount = _amount + (_amount * _interest) / 100;
        uint _fundingDeadline = block.timestamp + (1 days);
        uint loanId = loanCount++;

        Loan storage loan = loans[loanId];
        loan.amount = _amount;
        loan.interest = _interest;
        loan.duration = _duration;
        loan.repaymentAmount = _repaymentAmount;
        loan.fundingDeadline = _fundingDeadline;
        loan.borrower = msg.sender;
        loan.lender = payable(address(0));
        loan.active = true;
        loan.repaid = false;
        loan.collateralToken = _collateralToken;
        loan.collateralAmount = collateralAmount;

        emit LoanCreated(
            loanId,
            _amount,
            _interest,
            _duration,
            _fundingDeadline,
            msg.sender,
            address(0),
            _collateralToken,
            collateralAmount
        );
    }

    function fundLoan(uint _loanId) external payable onlyActiveLoan(_loanId) {
        Loan storage loan = loans[_loanId];
        require(msg.sender != loan.borrower, "Borrower cannot fund their own loan");
        require(msg.value == loan.amount, "Incorrect funding amount");
        require(block.timestamp <= loan.fundingDeadline, "Funding deadline passed");

        loan.lender = payable(msg.sender);
        loan.active = false;

        // Transfer loan amount to borrower
        payable(loan.borrower).transfer(msg.value);

        emit LoanFunded(_loanId, msg.sender, msg.value);
    }

    function repayLoan(uint _loanId) external payable onlyBorrower(_loanId) {
        Loan storage loan = loans[_loanId];
        require(!loan.repaid, "Loan already repaid");
        require(msg.value == loan.repaymentAmount, "Incorrect repayment amount");

        // Transfer repayment to lender
        loan.lender.transfer(msg.value);

        // Return collateral
        if (loan.collateralToken == address(WETH)) {
            WETH.withdraw(loan.collateralAmount);
            payable(loan.borrower).transfer(loan.collateralAmount);
        } else {
            require(
                IERC20(loan.collateralToken).transfer(loan.borrower, loan.collateralAmount),
                "Collateral return failed"
            );
        }

        loan.repaid = true;
        loan.active = false;

        emit LoanRepaid(_loanId, msg.value);
        emit CollateralReturned(_loanId, loan.collateralToken, loan.collateralAmount);
    }

    function liquidateLoan(uint _loanId) external {
        Loan storage loan = loans[_loanId];
        require(loan.active, "Loan not active");
        require(block.timestamp > loan.fundingDeadline + loan.duration, "Loan not expired");
        require(!loan.repaid, "Loan already repaid");

        // Transfer collateral to lender
        if (loan.collateralToken == address(WETH)) {
            WETH.withdraw(loan.collateralAmount);
            payable(loan.lender).transfer(loan.collateralAmount);
        } else {
            require(
                IERC20(loan.collateralToken).transfer(loan.lender, loan.collateralAmount),
                "Collateral liquidation failed"
            );
        }

        loan.active = false;
        emit CollateralLiquidated(_loanId, loan.collateralToken, loan.collateralAmount);
    }

    // Implementation of abstract function from LendingBase
    function getLoanInfo(uint _loanId)
        external
        view
        override
        returns (
            uint amount,
            uint interest,
            uint duration,
            uint repaymentAmount,
            uint fundingDeadline,
            address borrower,
            address lender,
            bool active,
            bool repaid,
            address collateralToken,
            uint collateralAmount
        )
    {
        Loan storage loan = loans[_loanId];
        return (
            loan.amount,
            loan.interest,
            loan.duration,
            loan.repaymentAmount,
            loan.fundingDeadline,
            loan.borrower,
            loan.lender,
            loan.active,
            loan.repaid,
            loan.collateralToken,
            loan.collateralAmount
        );
    }

    receive() external payable {}
}

